import React from 'react'
import styled from 'styled-components'

const Appsed = styled.div`
    background:#9e292b;
    height:400px;
    width:300px;
    border-style: solid;
    border-width: 5px;
    color: blue,
    top: 0px;
    position: relative;
    right: 0px;
    float: right;
    border-radius: 25px;

`
const Dropown = () => {
    return (
        <>
           <Appsed><p>Lorem Ipsum is simply dummy text of the unchanged.</p></Appsed> 
        </>
    )
}

export default Dropown
